import Menu from "./components/Menu/Menu";
import Home from "./components/Home/Home";
// import Home from "./components/Home/Home";

function App() {
  return (
    <div className={styles.container}>
      <Menu />

      <Home id="home" />
      <Home />
      <Home />
      <Home />
      <Home />
      <Home />

      <footer className={styles.footer}>
        <p>&copy; 2023 Ваша Компания. Все права защищены.</p>
      </footer>
    </div>
  );
}

export default App;
